import React, { Component } from 'react';
import './App.css';
import { Businesses } from './config.js';

console.log(Businesses);

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header"></header>
        <body className="App-body">
          <form>
            <label>
              Please tell us about yourself:
            </label><br /><br />

            <div className="inputSection">
              <input className="personalData" id="firstName" type="text" placeholder="First name"></input><br />
              <input className="personalData" id="lastName" type="text" placeholder="Last name"></input><br />
              <input className="personalData" id="age" type="number" placeholder="Age"></input><br />
              <input className="personalData" id="occupation" type="text" placeholder="Current occupation"></input><br />
              <input className="personalData" id="zipCode" type="number" placeholder="Zip code"></input><br />
              <input className="personalData" id="email" type="email" placeholder="Email address"></input><br />
            </div>

            <label>
              What type of businesses interest you?
            </label><br /><br />

            <ul id="businesses">
              <li><label><input type="checkbox" value="realEstate" className="checkbox" />Real Estate</label></li>
              <li><label><input type="checkbox" value="frachising" className="checkbox" />Franchising</label></li>
              <li><label><input type="checkbox" value="contentCreation" className="checkbox" />Content Creation</label></li>
            </ul>

            <input type="submit" value="Send" />
          </form>
        </body>
      </div>
    );
  }
}

export default App;
